import React from 'react'
import {Route} from "react-router-dom"
import RegisterPage from '../pages/Register'

function UserRoute() {
    return (
        <>
            
             <Route path="/" element = {<RegisterPage/>}/>

        </>
        
    )
}

export default UserRoute
